/// //layout 2 that sets all 4 labels' text and the button
/// vc.messageNameLabel.text = "Sign In Failed"
/// vc.messageDetailLabel.text = "You can try entering your passcode again in"
/// vc.messageEmphasisLabel.text = "5 minutes"
