///   </li>
///   <li>
///     disabled: Color to be used when control is disabled.
///   </li>
///   <li>
///     normal: Color to be used when control is enabled.
///   </li>
///   <li>
///     highlighted: Color to be used when control is tapped on.
///   </li>
